import React from 'react'

const DaysBar = props => {
    const days = props.days


    return(
        <ul style={{width: "300px", heigth: "300px", background: "LightPink", padding: "30px"}}>
            {days.map((day) => {
                return <li key={day.dt}>{new Date(day.dt * 1000).toDateString()}</li>
            })}
        </ul>
    )
}

export default DaysBar
